import React from 'react';

import style from './banner.css';
import banner from '../../UI/Img/ERP-Banner1-1536x560.png';

const Banner =()=>{
    return(
        <div>
            <img src={banner} alt='banner'  />
        </div>
    );
}

export default Banner;
